import Feature from "./Feature.jsx";
function App(){
    return (
        <div>
            <div class="homepage-content">
                <Header />
                <Title heading="SplitEqual" subheading="All Your Expenses in One Place" />
                <LoginOption />
            </div>
            <div class="purpose">
                <h1 id="purpose-head" class="section_para">SplitPurpose</h1>
                <p class="purpose-content section_para">Planning a trip with friends or family? SplitEqual allows you to 
                keep a track of your group expenses and helps clear dues, redeem amount instantly. Create an account to access 
                the premium features specially crafted for our members.</p>
            </div>
        </div>
        
        
    )
}
export default App;
